import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className= "App">
        <div className = "musicPlayer"></div>
        <div className = "songScroller">
            {songScroller()}
        </div>
    </div>
  );
}

function songScroller() {
    return (
        <button>
            Song Name
            <br></br>
            Artist
        </button>
    )
}
export default App;
